query System__GetMenus($pid: Int) @rbac(requireMatchAny: [admin]) {
  data: main_findManymenu(where: {level: {equals: 1}}, orderBy: {sort: asc}) {
    id @export(as: "pid")
    path
    label
    name
    sort
    children: _join {
      main_findManymenu(where: {parentId: {equals: $pid}}, orderBy: {sort: asc}) {
